  return "\r\n<!-- header section\r\n================================================== -->\r\n<div class=\"top-header\"></div>\r\n\r\n\r\n<!-- about section\r\n================================================== -->\r\n<section id=\"about\" class=\"paralla-section\">\r\n	<div class=\"container\">\r\n		<div class=\"row\">\r\n        \r\n			<div class=\"col-md-6 col-sm-12\">\r\n				<img src=\"/images/bigstock--124710584.jpg\" class=\"img-responsive\" alt=\"about img 1\">\r\n			</div>\r\n            \r\n			<div class=\"col-md-6 col-sm-12\">\r\n				<div class=\"about-des\">\r\n					<h4>Success by Evaluating Risk</h4>\r\n					<h3>AI Powered Risk Management</h3>\r\n					<p>Diversified Risk Solutions&reg; is a leading provider of insurance, risk management, bonding, consulting and employee benefits solutions to individuals and businesses globally. \r\n			Our team of industry leading professionals utilize our LOGIC system, the most advanced technology available, with our core value emphasis on personal relationships to ensure that we deliver custom tailored solutions in an \r\n			increasingly commoditized industry. Thanks to Divrisk's proprietary agent platform, which uses artificial intelligence and machine learning, it has been able to grow the business by streamlining processes. </p>\r\n			 \r\n					\r\n				</div>\r\n			</div>\r\n\r\n		</div>\r\n        \r\n        <div class=\"row\">\r\n			\r\n			<div class=\"col-md-6 col-sm-12\">\r\n				<div class=\"about-des\">\r\n					<h4>Modern Insurance Agency</h4>\r\n					<h3>Bringing YOU to the NEXT Level</h3>\r\n					<p>The Diversified Risk Solutions&reg; culture emphasizes education and professional development, with a team composed of individuals with professional experience and training. The rigorous educational foundation can be seen first hand by our President & Founder Paul Gaglioti III, CIC. A Certified Insurance Counselor (CIC) is one of the nation's most prestigious professional designations, with only 30,000 professionals globally that have attained such a feat. \r\n					With over 18 hours of testing and 100 hours of in depth classroom education, the CIC is a designation unlike any other. More about the CIC can be found here.</a></p>\r\n            <p>Diversified Risk Solutions&reg; was founded on one key principle: Success by evaluating risk. Our team of licensed professionals works with clients of all sizes, considering each of their unique risks and goals. We start with the needs of our clients and ends with an appropriate program that is structured for change to provide our clients the best overall combination of coverage, service and value. In turn, our clients are provided with the most comprehensive products relative to each client's unique needs. Our team exceeds expectations for all clients because our team doesn't just hold itself out as a professional organization we cultivate it. Each team member pursues educational and professional development goals in insurance and related industries. We maintain focus on the future to provide industry-leading products with an emphasis on the best value added service. With us, clients are not just a policy number.</p>\r\n					\r\n					\r\n				</div>\r\n			</div>\r\n            \r\n            <div class=\"col-md-6 col-sm-12\">\r\n				<img src=\"/images/app.png\" class=\"img-responsive\" alt=\"about img 2\">\r\n			</div>\r\n\r\n		</div>\r\n	</div>\r\n</section>\r\n\r\n\r\n<!-- blog section\r\n================================================== -->\r\n<section id=\"services\" class=\"paralla-section\">\r\n	<div class=\"container\">\r\n		<div class=\"row\">\r\n			<h2><font color=\"#ffa400\">OUR SERVICES</font></h2>\r\n			<h4>Powerful Risk Management System</h4>\r\n\r\n			<div class=\"blog-masonry masonry-true\">\r\n\r\n				<div class=\"post-masonry col-md-4 col-sm-6 wow fadeInUp\">\r\n					<div class=\"blog-wrapper\">\r\n						<img src=\"/images/bigstock--164482571.jpg\" class=\"img-responsive\" alt=\"blog img\">\r\n						<h3><a href=\"126/CommercialInsurance/CommercialPackagePolicy.html\">Commercial Package Policy</a></h3>\r\n					<p>A commercial package policy provides both property and liability coverage. It offers you a variety of bundle options and greater flexibility for mid to large-size businesses and high-hazard type of businesses. The commercial packaging policy covers assets that are a part of your\r\n				business such as the building, contents, equipment, and computers.</p>\r\n					</div>\r\n				</div>\r\n				<div class=\"post-masonry col-md-4 col-sm-6 wow fadeInUp\" data-wow-delay=\"0.2s\">\r\n					<div class=\"blog-wrapper\">\r\n						<img src=\"/images/blog-img-2.jpg\" class=\"img-responsive\" alt=\"blog img\">\r\n						<h3><a href=\"880/PersonalInsurance/SpecialEvent.html\">Special Events Policy</a></h3>\r\n						<p>If you are having a public event whether a wedding and reception or a festival you need the protection of Special Event Insurance. Our Event Liability Insurance is designed to protect the policyholder against lawsuits, cancellation, claims made related to bodily injury of others, and property damage to the rented premise.</p>\r\n				</div>\r\n				</div>\r\n				<div class=\"post-masonry col-md-4 col-sm-6 wow fadeInUp\" data-wow-delay=\"0.4s\">\r\n					<div class=\"blog-wrapper\">\r\n						<img src=\"/images/bigstock-Female-business-owner-holding--168372248.jpg\" class=\"img-responsive\" alt=\"blog img\">\r\n						<h3><a href=\"160/CommercialInsurance/BusinessOwnerPolicy.html\">Small Business Policy</a></h3>\r\n						<p>A business owner needs a bundled package of general liability, workers' compensation, property protection, and professional liability. A BOP can help cover your business from claims resulting from events such fires, theft, or any other kind of disaster and from claims involving bodily injury, property damage and personal and advertising injury.</p>\r\n\r\n					</div>\r\n				</div>\r\n				<div class=\"post-masonry col-md-4 col-sm-6 wow fadeInUp\" data-wow-delay=\"0.6s\">\r\n					<div class=\"blog-wrapper\">\r\n						<img src=\"/images/bigstock-Couple-eating-at-hotel-restaur-185381023.jpg\" class=\"img-responsive\" alt=\"blog img\">\r\n						<h3><a href=\"025/PersonalInsurance/Personal.html\">Personal Insurance</a></h3>\r\n						<p>You pride yourself on being an individual and we appreciate that about you. Each of your unique interests, hobbies and tastes make you distinct from everyone else. However, the downside is that many insurance programs may not be the right fit for individuals like you. Perhaps, your stamp collection turns into more than a hobby or that table Aunt Suzy gave you ended up being built in the 1700s and you need an insurance program that fits your needs. Our Personal Risk Solution program is perfect for you because it is all about you.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div class=\"post-masonry col-md-4 col-sm-6 wow fadeInUp\" data-wow-delay=\"0.8s\">\r\n					<div class=\"blog-wrapper\">\r\n						<img src=\"/images/bigstock-American-style-truck-on-freewa-170163227.jpg\" class=\"img-responsive\" alt=\"blog img\">\r\n						<h3><a href=\"127/CommercialInsurance/BusinessAuto.html\">Business Auto Insurance</a></h3>\r\n						\r\n						<p>Business Auto Liability insurance helps cover financial risks and protects company assets if you or your employees are at fault in an automobile accident that results in injuries or property damages. Here at Diversified Risk Solutions, we can help you with all your questions, hesitations, and concerns to help ensure you feel like your company is being protected. Even if you are unsure if you need this type of insurance, give us a call. If you use any kind of vehicle for a business purpose, it's always best to have the right protection especially when a unique situation arises.</p>\r\n					</div>\r\n				</div>\r\n				<div class=\"post-masonry col-md-4 col-sm-6 wow fadeInUp\" data-wow-delay=\"1.0s\">\r\n					<div class=\"blog-wrapper\">\r\n						<img src=\"/images/bigstock-blue-glass-wall-of-modern-comm-18518501.jpg\" class=\"img-responsive\" alt=\"blog img\">\r\n						<h3><a href=\"140/CommercialInsurance/Property.html\">Property Insurance</a></h3>\r\n						<p>Commercial Property Insurance helps your business stay protected in case of an emergency. It covers the business' property, all the tools and equipment, and any kind of assets inside the building that are <strong>owned</strong> or <strong>leased</strong>. Businesses can also have different commercial property insurance on different items. If there are certain valuable papers or records, there can be additional coverage on those specific items.</p>\r\n					</div>\r\n				</div>\r\n				<div class=\"post-masonry col-md-4 col-sm-6 wow fadeInUp\" data-wow-delay=\"0.2s\">\r\n					<div class=\"blog-wrapper\">\r\n						<img src=\"/images/bigstock-Production-Line-In-Modern-Dair-1282691.jpg\" class=\"img-responsive\" alt=\"blog img\">\r\n						<h3>Product Recall Insurance</h3>\r\n						<p>Product recall insurance is a pretty useful tool if your company is one who designs, manufactures, distributes, or sells any kind of product, ranging from shampoo to pizza to office supplies. It is strongly advisable in any event that your company's product is defective or damaging to a consumer's life or property.  Product recall liability will provide financial coverage and protection in these types of situations. Product recall liability is set up in two different ways. First, it can be added to your already existing general liability insurance policy or, secondly, it can be purchased separately and customized to tailor your business the right way. </p>\r\n					</div>\r\n				</div>\r\n				<div class=\"post-masonry col-md-4 col-sm-6 wow fadeInUp\" data-wow-delay=\"0.2s\">\r\n					<div class=\"blog-wrapper\">\r\n						<img src=\"/images/bigstock-building-under-construction-wi-19570979.jpg\" class=\"img-responsive\" alt=\"blog img\">\r\n						<h3><a href=\"237/Industry/Construction.html\">Construction Industry</a></h3>\r\n						<p>While working on projects such as ones with a large investment rate and multiple complex parts, there many types of risks that can threaten a business. They can range from contractual and surety needs to environmental exposes and federal protected areas to security of the site. In this industry, it is a must work with the insurer and have a complete understanding and commitment.\r\nOur brokers can help to customize the coverage your business needs.</p>\r\n</div>\r\n				</div>\r\n				<div class=\"post-masonry col-md-4 col-sm-6 wow fadeInUp\" data-wow-delay=\"0.2s\">\r\n					<div class=\"blog-wrapper\">\r\n						<img src=\"/images/bigstock--180674380.jpg\" class=\"img-responsive\" alt=\"blog img\">\r\n						<h3><a href=\"080/PersonalInsurance/HomeownerPolicy.html\">Homeowner Insurance</a></h3>\r\n						<p>Homeowners insurance is designed to cover your home and any possessions inside of it from risks such as burglary, theft, fire, or severe storms. \r\n						If you have guests over, your home liability coverage can protect you from financial responsibility that may arise if anyone gets injured during their visit or if any of their personal property is damaged at your residence.</p>\r\n</div>\r\n				</div>\r\n				\r\n				\r\n				\r\n			</div>\r\n\r\n		</div>\r\n	</div>\r\n</section>\r\n\r\n\r\n\r\n\r\n<div class=\"product-showcase\">\r\n    <!-- PROMOTED -->\r\n    <h3 style=\"text-align: center;\">Promoted</h3>\r\n    <div class=\"promoted-entities\">\r\n        <div class=\"promoted-item\">\r\n\r\n        "
